// Cart.vue

import React from 'react';
import PropTypes from 'prop-types';

let item = {
    image: {
        url: 'https://cdn.shopify.com/s/files/1/0270/2098/4401/products/1_1_360x.jpg?v=1596208769'
    },
    name: 'Product',
    quantity: 1,
    line_total: {
        formatted_with_symbol: '$9.99'
    }
}

const CartItem = ({ item }) => {

  return (
    <div className="cart-item">
      <img className="cart-item__image" src={item.image.url} alt={item.name} />
      <div className="cart-item__details">
        <h4 className="cart-item__details-name">{item.name}</h4>
        <div className="cart-item__details-qty">
          <p>{item.quantity}</p>
        </div>
        <div className="cart-item__details-price">{item.line_total.formatted_with_symbol}</div>
      </div>
      <button
        type="button"
        className="cart-item__remove"
      >
        Remove
      </button>
    </div>
  );
};

CartItem.propTypes = {
    item: PropTypes.object,
};

export default CartItem;
